.guidelines_content {
background: #fff;
padding: 12px 24px;
text-align: justify;
color: #003580;
}
.guidelines_content_lightbox {
background: #fff;
padding: 12px 24px;
text-align: justify;
height: 400px;
overflow-y: scroll;
color: #003580;
}
.guidelines_content p,
.guidelines_content_lightbox p {
margin: 1em 0;
}
.guidelines_content .head,
.guidelines_content_lightbox .head {
font-weight: bold;
font-size: 16px;
}
@media (max-device-width: 600px) {
.guidelines_content {
width: auto;
text-align: left;
}
}

